const axios = require('axios')


const getUserLocation = (setLocation) => {

    axios.get("https://geolocation-db.com/json/8dd79c70-0801-11ec-a29f-e381a788c2c0")
            .then((res) => {
                setLocation(res.data)
            })

}

module.exports = { getUserLocation }
